import React from 'react';
import logo from './portfolioImg.jpeg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Jacqueline Gwynn</h1>
        <p>
          Full Stack Engineer with a background in front-end
          and API development. Supporting a financial services company within
          RTP. Skillset include but not limited to Requirements Analysis,
          Agile, Javascript,continous integration and angular. Experience
          within the scrum team member and played multiple roles including UI
          developer, QA, and scrum master. Lead a team of 2 squads.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
